// App.js

import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './HomePage'; // Importuj komponent HomePage
import Calendar from './Calendar';
import HourPicker from './HourPicker';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<HomePage />} /> {/* Renderuj stronę główną */}
          <Route path="/calendar" element={<Calendar />} />
          <Route path="/hourpicker/:day" element={<HourPicker />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
